import React from 'react';
import VectorSmartObject1Image from 'src/assets/images/start1_Vector_Smart_Object_1.png';
import VectorSmartObject2Image from 'src/assets/images/start1_Vector_Smart_Object_2.png';
import VectorImage from 'src/assets/images/start1_Vector.png';
import Vector1Image from 'src/assets/images/start1_Vector_1.png';
import { styled } from '@mui/material/styles';
import './Login.scss'



const Vector = styled('img')({
  height: `51.75px`,
  width: `69px`,
  position: `absolute`,
  left: `0px`,
  top: `9px`,
});

const AboutPrivacyFaq = styled('div')({
  textAlign: `left`,
  whiteSpace: `pre-wrap`,
  fontSynthesis: `none`,
  color: `rgba(255, 255, 255, 1)`,
  fontStyle: `normal`,
  fontFamily: `Sansation`,
  fontWeight: `400`,
  fontSize: `32px`,
  letterSpacing: `0px`,
  textDecoration: `none`,
  lineHeight: `75px`,
  textTransform: `none`,
  width: `167px`,
  height: `209px`,
  position: `absolute`,
  left: `207px`,
  top: `1042px`,
});

const Q8545449SpotifyLogoS = styled('div')({
  display: `flex`,
  position: `absolute`,
  isolation: `isolate`,
  flexDirection: `row`,
  justifyContent: `flex-start`,
  alignItems: `flex-start`,
  width: `128px`,
  height: `128px`,
  left: `1550px`,
  top: `607px`,
  overflow: `hidden`,
});

const SpotifyLogoWithoutTe = styled('div')({
  display: `flex`,
  position: `absolute`,
  isolation: `isolate`,
  flexDirection: `row`,
  justifyContent: `flex-start`,
  alignItems: `flex-start`,
  padding: `0px`,
  boxSizing: `border-box`,
  width: `60px`,
  height: `60px`,
  left: `1721px`,
  top: `505px`,
  overflow: `hidden`,
});

const Vector1 = styled('img')({
  height: `59.82px`,
  width: `59.82px`,
  position: `absolute`,
  left: `0px`,
  top: `0px`,
});

function Login(props) {
  return (
    <div id='main' className={props.className}>
      <img
        id='VectorSmartObject1'
        src={VectorSmartObject1Image}
        loading="lazy"
        alt={'Vector Smart Object 1'}
      />
      <div id='Group2'>
        <div id='Rectangle4'></div>
        <div id='LogIn'>{`Log In`}</div>
      </div>
      <div id='Rectangle2'></div>
      {false && (
        <img
          id='VectorSmartObject2'
          src={VectorSmartObject2Image}
          loading="lazy"
          alt={'Vector Smart Object 2'}
        />
      )}
      <div id='Tastyfy'>{`Tastyfy`}</div>
      <div id='Tastyfy1'>
        <span id='Tastyfy1Span1'>{`Tastyfy`}</span>
        <span id='Tastyfy1Span2'>{` – це аналізатор музичних уподобань, який допомагає користувачам дізнатися більше про свій смак та відкривати для себе нову музику, яка
відповідає їхнім особистим вподобанням.`}</span>
      </div>
      <div id='Email'>
        <img id='Vector' src={VectorImage} loading="lazy" alt={'Vector'} />
      </div>
      <AboutPrivacyFaq>
        {`About
Privacy
FAQ`}
      </AboutPrivacyFaq>
      <Q8545449SpotifyLogoS></Q8545449SpotifyLogoS>
      <SpotifyLogoWithoutTe>
        <Vector1 src={Vector1Image} loading="lazy" alt={'Vector'} />
      </SpotifyLogoWithoutTe>
    </div>
  );
}

export default Login;
